$.ajaxPrefilter(function(options) {
    if(typeof options.data == "undefined" || options.data == null){
        options.data = '';
    }

    if ( options.type.toUpperCase() === 'POST') {
        if(typeof options.data == 'string') {
            options.data += '&csrf_test_name='+csrf_test_name;
        } else {
            options.data['csrf_test_name'] = csrf_test_name;
        }
    }
});